(102542, 'chi', 'backend', 'concessions_means_gift_maximum_number', 'label', NULL, '当优惠方式为“享受赠品（特惠品）”时，请输入允许买家选择赠品（特惠品）的最大数量，数量为0表示不限数量；当优惠方式为“享受现金减免”时，请输入现金减免的金额；当优惠方式为“享受价格折扣”时，请输入折扣（1－99），如：打9折，就输入90。', '2008-01-01 00:00:00', '2011-09-28 23:12:14'),
(102543, 'jpn', 'backend', 'concessions_means_gift_maximum_number', 'label', NULL, 'ときに優遇方式を「楽しむ景品（特恵品）」の場合、許可を入力してくださいバイヤー景品（特恵品）の最大数の数を制限しない、0表示数；優遇方式を「楽しむ現金減免”時、現金減免の金額を入力してください；優遇方式を「楽しむ価格の割引」にを入力してください割引（1－99）を折って、例えば：9、入力90。', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
